sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var res=inputs.error;
var statusdetail=inputs.detail;

if(!res.head){
    res=JSON.parse(res);
}

if(res.head.status=="Failed" || res.head.status=="Failure" || res.head.statusCode=="400"){
    outputs.status="Failure";
    outputs.detail=statusdetail;
    var errorMessage=[];
    if(res.head.errordetails && res.head.errordetails.length>0){
        res.head.errordetails.forEach(function(error){
            errorMessage.push(error.msg);
        })
        if(errorMessage.length==0){
            errorMessage.push("Internal Server Error");
        }

        outputs.code=500;
        outputs.res=errorMessage.toString();
    }
}
else if(res.head.status=="Success" ||  res.head.statusCode=="200"){
    outputs.res="";
    outputs.code=200;
    outputs.status="Success";
}

})(inputs, outputs);

